import './style.scss'
const Header = () =>{
    return(
        <div className='header'>
            <div className='header__logo'>logo</div>
            <nav className='header__nav'>
                <ul>
                    <li>asd</li>
                    <li>asdzx</li>
                    <li>cxv</li>
                    <li>zxcgd</li>
                </ul>
            </nav>
        </div>
    );
};
